var title_f24_16_24842="US normal T cervix";
var content_f24_16_24842=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F77352%7EOBGYN%2F66107%7EOBGYN%2F52234&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F77352%7EOBGYN%2F66107%7EOBGYN%2F52234&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    US normal T cervix",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 450px; height: 397px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal cervix, no funneling (\"T-shaped\"). Note prominent endocervical mucus, small Nabothian cyst near external os. Lower uterine segment (LUS) thick and not developed.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Jeffrey R. Johnson, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    US Y funnel cervix",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 450px; height: 394px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Funneling cervix, with walls of funnel in \"Y-shaped\" configuration. Membranes are not visible separately, and there is no evidence of prolapsed membranes beyond internal os.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Jeffrey R. Johnson, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    US U funnel cervix",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 450px; height: 388px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Nearly completely effaced cervix, with \"U-shaped\" funnel. Membranes are seen prolapsing just beyond the internal os. Note the cerclage visible in the anterior and posterior lips of the cervix. The LUS is thin and bulging somewhat.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Jeffrey R. Johnson, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
