" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Mnemonic for causes of acute liver failure: The ABCs",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        A",
"       </td>",
"       <td>",
"        Acetaminophen, hepatitis A, autoimmune hepatitis,",
"        <em>",
"         Amanita phalloides",
"        </em>",
"        (mushroom poisoning), adenovirus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B",
"       </td>",
"       <td>",
"        Hepatitis B, Budd-Chiari syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C",
"       </td>",
"       <td>",
"        Cryptogenic, hepatitis C, CMV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        D",
"       </td>",
"       <td>",
"        Hepatitis D, drugs and toxins",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        E",
"       </td>",
"       <td>",
"        Hepatitis E, EBV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        F",
"       </td>",
"       <td>",
"        Fatty Infiltration - acute fatty liver of pregnancy, Reye's syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        G&nbsp;",
"       </td>",
"       <td>",
"        Genetic - Wilson disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        H",
"       </td>",
"       <td>",
"        Hypoperfusion (ischemic hepatitis, VOD, sepsis), HELLP syndrome, HSV, heat stroke, hepatectomy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I&nbsp;&nbsp;&nbsp;",
"       </td>",
"       <td>",
"        Infiltration by tumor",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CMV: cytomegalovirus; EBV: Epstein-Barr virus; HELLP: hemolysis, elevated liver enzymes, low platelets; HSV: herpes simplex virus; VOD: veno-occlusive disease.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
