"    Table of the biological value of common foods",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"2\" width=\"50%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Food item",
"       </td>",
"       <td class=\"subtitle1\">",
"        Biological value",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Egg protein",
"       </td>",
"       <td class=\"centered\">",
"        100",
"       </td>",
"      </tr>",
"      <tr>",
