"   <div class=\"lgnd\">",
"    This table depicts common food items with their BV values. Biological value (BV) is a measure of the proportion of absorbed protein that is incorporated into the proteins of the body. One method of determining biological value measures absorbed and excreted nitrogen and determines the ratio of incorporated nitrogen to absorbed nitrogen:",
"    <br/>",
"    &bull; BV = (Nr/Na) x 100.",
"    <br/>",
"    &bull; Nr = nitrogen retained in the body (measured indirectly by nitrogen excretion in the urine and feces).",
"    <br/>",
"    &bull; Na = absorbed nitrogen from dietary protein.",
"    <br/>",
"    &bull; A BV of 100 suggests complete utilization of protein from a particular food. Egg protein has a BV of 100.",
"    <br/>",
"    &bull; BV does not take into account how readily the protein can be digested and absorbed.",
"    <div class=\"footnotes\">",
"    </div>",
